import React, { Component } from "react";
import Portfolio from "./../Portfolio/Portfolio";
export default class Investmentstyle extends Component {
  state = {
    data: [
      {
        percentage:30,
        color:"green",
        heading: "Money Market",
        nav: "$10.02",
        units: "9,530,495.01",
        market: "$95,495.01",
        points: [{x: 1, y: 2}, {x: 3, y: 5}, {x: 7, y: -3},{x:8,y:3}] 
      },
      {
          percentage:55,
          color:"blue",
        heading: "Conservative grouth",
        nav: "$10.02",
        units: "9,530,495.01",
        market: "$95,495.01",
        points: [{x: 2, y: 3}, {x: 4, y: 5}, {x: -1, y: -3},{x:8,y:3}] 
      },
      {
          percentage:100,
          color:"brown",
        heading: "Income",
        nav: "$10.02",
        units: "9,530,495.01",
        market: "$95,495.01",
        points: [{x: -1, y: 2}, {x: 5, y: 5}, {x: 6, y: 7},{x:8,y:3}] 
      }
    ]
  };
  render() {
    return (
      <div>
        <div style={{ margin: "30px 0px" }}>
          <div>Your Allocation</div>
          <div style={{margin:"10px 0px"}}>Investment Performance</div>
        </div>
        <div>Portfolio Builders</div>
        {this.state.data.map(value => (
          <Portfolio value={value} />
        ))}
      </div>
    );
  }
}
